var theme={CSS_PATH:[],list:[],addPath:function(b){if(Array.isArray(b)){for(var a=0;a<b.length;a++){theme.CSS_PATH[theme.CSS_PATH.length+a]=b[a]}}else{theme.CSS_PATH[theme.CSS_PATH.length]=b}},init:function(b){if(b==null||b==""){var a=localStorage.getItem("_sw_theme_cur");if(a!=null&&a!=""){a=parseInt(a);if(a!=-1){b=theme.list[a]}}}if(b!=null){for(var c=0;c<theme.CSS_PATH.length;c++){var d=document.createElement("link");d.rel="stylesheet";d.href=theme.CSS_PATH[c]+"-"+b+".css";d.setAttribute("sw-theme","");document.body.appendChild(d)}}},switchT:function(b){var d=0;if(b==null||b==""){var a=localStorage.getItem("_sw_theme_cur");if(a!=null&&a!=""){a=parseInt(a);if(a==-1){b=theme.list[d]}else{d=a+1;if(d>=theme.list.length){d=0}b=theme.list[d]}}}else{for(var c=0;c<theme.list.length;c++){if(theme.list[c]==b){d=c;break}}}document.querySelectorAll("[sw-theme]").forEach(function(f){f.parentNode.removeChild(f)});localStorage.setItem("_sw_theme_cur",d);theme.init()}};